export default function RenderList() {
  const Fruits = [
    {
        fruit : "apple",
        vegetable : "potato"
    },
    {
        vehicle : ''
    }
  ]

  const ListItems = Fruits.map((Fruits) => <li>{Fruits}</li>);

  return ListItems;
}
